  <app-root>
    <style>
      body {
        margin: 0;
        padding: 0;
      }

      .siteloader {
        display: flex;
        align-items: center;
        justify-content: center;
        width: 100%;
        height: 100%;
        position: absolute;
        font-family: Arial, Helvetica, sans-serif;
        animation: fadein 1s;
      }

      .siteloader__container {
        position: absolute;
        bottom: calc(50% - 32px); // Spinner has to be in the center of the screen;
        text-align: center;
      }

      .siteloader__logo {
        margin-bottom: 24px;
      }

      .siteloader__info {
        margin-bottom: 67px;
        color: #333;
      }

      .siteloader__spinner {
        width: 54px;
        height: 54px;
        margin: 0 auto;
        border: 5px solid #858585;
        border-bottom-color: transparent;
        border-radius: 50%;
        animation: spin-it 2s linear infinite;
      }

      @keyframes spin-it {
        from {
          transform: rotate(0deg);
        }
        to {
          transform: rotate(359deg);
        }
      }

      @keyframes fadein {
        from {
          opacity: 0.3;
        }
        to {
          opacity: 1;
        }
      }
    </style>
